### Compute the number of breakpoints in a permutation ###

# the input permutation should be converted into a string first
def BreakPoints(p):
    p = listed(p)
    p.insert(0,0) and p.insert(-1,len(p)+1)
    breakpoints = 0
    for i in range(len(p)-1):
        if int(p[i+1]) - int(p[i]) != 1:
            breakpoints += 1
    return breakpoints

def listed(p):
    return p.lstrip("(").rstrip(")").split()

